  false,\n\t\"url\": null,\n\t\"notes\": \"Cape Cod Bay, lying on the Massachusetts
  coast partly enclosed by Cape Cod, is in a glaciated region of low relief. Coarse
  sediments generally occur in areas exposed to wave and current action as in shallow
  water near shore or on shoals, and in the deep channel north of the tip of Cape
  Cod, which is swept by tidal currents. Fine sediments are restricted to the deeper
  water in the central portion of the Bay, and to the small well-protected embayments
  of the shore. Although Hough (1942) is available as part of the NGDC Deck 41 Database,
  additional data from the original report were manually entered and, therefore, this
  file is unque.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
